import gql from 'graphql-tag';

const SingleProduct = ({ query }) => <p>Hey I'm a single product {query.id}</p>;
export default SingleProduct;

const SINGLE_ITEM_QUERY = gql`
query {
  Product(where: {id: "60ad178fcaa1d6eaca165278"
  }) {
    name
    price
    description
  }
  })
}`;
